import React from "react";

import styles from "./Post.module.scss";

export function Post({ sender, content, likeContent, activeInput }) {
  console.log(content, "content");
  console.log(activeInput, "activeInput");
  return (
    <div className={`${styles.post} boxBorder`}>
      <div className={styles.post__header}>
        <div className={styles.post__header_info}></div>
        <div className={styles.post__header_actions}></div>
      </div>
      <div className={styles.post__content}>
        <div className={styles.post__content_text}></div>
        <div className={styles.post__content_mediaContent}></div>
      </div>
      <div className={styles.post__likeBlock}>
        <div className={styles.post__likeBlock_likebtn}> </div>
        <div className={styles.post__likeBlock_likeViews}> </div>
      </div>
    </div>
  );
}
